PC Number: 2019-1253Date: 2019-08-26


Her Excellency the Governor General in Council, on the recommendation of the Minister of Foreign Affairs, appoints:

 

Graeme Clark as Ambassador Extraordinary and Plenipotentiary of Canada to the United Mexican States;

Michael Elliott as Ambassador Extraordinary and Plenipotentiary of Canada to the Republic of Mali;

Ralph Jansen as Ambassador Extraordinary and Plenipotentiary of Canada to the Republic of Peru, with concurrent accreditation as Ambassador Extraordinary and Plenipotentiary of Canada to the Plurinational State of Bolivia, with residence in Lima; 

Carol McQueen as Ambassador Extraordinary and Plenipotentiary of Canada to Burkina Faso; and 

Ayesha Rekhi as Ambassador Extraordinary and Plenipotentiary of Canada to the Czech Republic.


 

Sur recommandation de la ministre des Affaires étrangères, Son Excellence la Gouverneure générale en conseil nomme :

 

Graeme Clark en qualité d’ambassadeur extraordinaire et plénipotentiaire du Canada auprès des États-Unis du Mexique; 

Michael Elliott en qualité d’ambassadeur extraordinaire et plénipotentiaire du Canada auprès de la République du Mali; 

Ralph Jansen en qualité d’ambassadeur extraordinaire et plénipotentiaire du Canada auprès de la République du Pérou, avec accréditation simultanée en qualité d’ambassadeur extraordinaire et plénipotentiaire du Canada auprès de l’État plurinational de Bolivie, avec résidence à Lima;

Carol McQueen en qualité d’ambassadrice extraordinaire et plénipotentiaire du Canada auprès du Burkina Faso; 

Ayesha Rekhi en qualité d’ambassadrice extraordinaire et plénipotentiaire du Canada auprès de la République tchèque.
